import React from 'react'
import {BrowserRouter,Route,Routes} from 'react-router-dom';

const RouterMain = () => {
  return (
    <BrowserRouter>
        <Routes>
            <Route path='/' element={<div>This is home page...</div>} ></Route>
        </Routes>
    </BrowserRouter>
  )
}

export default RouterMain
